export default [
  {
    prompt: "Which continent is shown in the image below?",
    imageUri: "https://github.com/DKALAJ1239/my-app/blob/master/assets/brand_pic.PNG?raw=true",
    options: [
      {
        id: "0",
        option: "A",
        answer: "South America",
      },
      {
        id: "1",
        option: "B",
        answer: "Europe",
      },
      {
        id: "2",
        option: "C",
        answer: "Asia",
      },
      {
        id: "3",
        option: "D",
        answer: "India",
      },
    ],
  },
];
